import * as React from 'react';
import styled from 'styled-components';

import { colors } from '../../theme/theme';

export const Container = styled.div`
  border: 1px solid ${colors.gray};
  background-color: ${colors.primary};
  border-radius: 20px;
  display: flex;
  align-items: center;
  height: 42px;
  position: relative;
  padding: 0;
`;
